#include "common.h"

class FindElements {
    // For some reasons, using an unordered_map doesn't work on leetcode for test case 80, but works here
    // I'll keep unordered_map
    unordered_map<int, vector<TreeNode *>> targetMap;

  public:
    FindElements(TreeNode *root) {
        root->val = 0;
        targetMap[0].push_back(root);
    }

    bool find(int target) {
        if (target == 0) {
            return true;
        }

        if (targetMap.count(target) > 0) {
            return true;
        }

        list<int> newValues;
        auto end = targetMap.end();
        for (auto it = targetMap.begin(); it != end; it++) { // Do current known values first
            if (it->first > target) {
                continue;
            }
            for (TreeNode *node : it->second) {
                if (node->left != nullptr && node->left->val == -1) {
                    node->left->val = node->val * 2 + 1;
                    targetMap[node->left->val].push_back(node->left);
                    newValues.push_back(node->left->val);
                    if (node->left->val == target) {
                        return true;
                    }
                }
                if (node->right != nullptr && node->right->val == -1) {
                    node->right->val = node->val * 2 + 2;
                    targetMap[node->right->val].push_back(node->right);
                    newValues.push_back(node->right->val);
                    if (node->right->val == target) {
                        return true;
                    }
                }
            }
        }
        for (auto it = newValues.begin(); it != newValues.end(); it++) { // Then newly added values
            if (*it > target) {
                continue;
            }
            for (TreeNode *node : targetMap[*it]) {
                if (node->left != nullptr && node->left->val == -1) {
                    node->left->val = node->val * 2 + 1;
                    targetMap[node->left->val].push_back(node->left);
                    newValues.push_back(node->left->val);
                    if (node->left->val == target) {
                        return true;
                    }
                }
                if (node->right != nullptr && node->right->val == -1) {
                    node->right->val = node->val * 2 + 2;
                    targetMap[node->right->val].push_back(node->right);
                    newValues.push_back(node->right->val);
                    if (node->right->val == target) {
                        return true;
                    }
                }
            }
        }

        return false;
    }
};

class Solution {
  public:
    vector<bool> main(vector<string> commands, TreeNode *treeNode, vector<int> operands) {
        vector<bool> ans;
        FindElements *findElements;
        int operandIndex = 0;
        for (auto command : commands) {
            if (command == "FindElements") {
                findElements = new FindElements(treeNode);
            } else if (command == "find") {
                ans.push_back(findElements->find(operands[operandIndex++]));
            }
        }

        return ans;
    }
};

